import React, { Component } from "react";
import MainSection from "../components/MainSection";
import ArticleItem from "../components/ArticleItem";

class Home extends Component {
  render() {
    return (
      <React.Fragment>
        <MainSection />
        <ArticleItem />
      </React.Fragment>
    );
  }
}

export default Home;
